// Pets.js

import React from 'react'
import { Link } from 'react-router-dom';

import Header from '/Header.js'

function Pets() {
    return (
        
        <div>
            <div>
                <h1>Pets</h1>
            </div>
            <p>This is the Pets Page.</p>
            <Link to="/" className="btn btn-secondary">Register</Link>
        </div>
    )
}

export default Pets
